  true,\n\t\"url\": null,\n\t\"notes\": \"The ER-2 Lightning Instrument Package measures
  the electric field above, below, and around the aircraft. The ER-2 LIP consists
  of eight electric field mills, a conductivity probe, and the associated data system.
  One of the field mills is installed on the upper Q-bay hatch cover and the second
  one is mounted on the aft section of the Advanced Microwave Precipitation Radiometer
  (AMPR) fairing. Three mills are each located on the superpods: one on the top, two
  on the bottom. The conductivity probe is integrated in the right hand superpod nose
  cone. The ER-2 LIP data system is mounted in a 19 inch vertical rack located in
  the aft section of the ER-2 Q-bay. The ER-2 electric field mills and the conductivity
  probe are compact sensors, each weighing less than 5 lbs.\",\n\t\"license_title\":
